import React from 'react';
import dogsdata from "../dogsdata";
import {
    Card, CardImg, CardText, CardBody,
    CardTitle, CardSubtitle, Button
  } from 'reactstrap';

const DetailDogs = ({match}) => {
    const {id} = match.params;
    const secilen = dogsdata.find(secilen => secilen.id === id)

    return(
        <div>

            <img src={secilen.image} alt="dog"></img>
           
           
           Dog Age: {secilen.age}<br/>
           Dog Breed: {secilen.breed}<br/>
           Description {secilen.description}<br/>
           Published: {secilen.published_at}<br/>
        
        
           <Card>
        <CardImg top width="50%" src={secilen.image} alt="dog" />
        <CardBody>
          <CardTitle>Dog Name: {secilen.name}<br/></CardTitle>
          <CardSubtitle>Dog ID: {id} <br/></CardSubtitle>
          <CardText>Some quick example text to build on the card title and make up the bulk of the card's content.</CardText>
          <Button>Button</Button>
        </CardBody>
      </Card>
        </div>
    )
}





export default DetailDogs;
